title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o12377.m19 -> o12374.m22 -> o12377.m19
  o12377.m28 -> o12374.m18 -> o12377.m25 -> o12374.m18
  o12377.m25 -> o12374.m18 -> o12377.m25
  o12377.m4 -> o12374.m22 -> o12377.m19 -> o12374.m22
  o12374.m22 -> o12377.m19 -> o12374.m22
  o12377.m5 -> o12374.m18 -> o12377.m25 -> o12374.m18
  o12374.m18 -> o12377.m25 -> o12374.m18

features:
  - inheritance
  - overriding
  - method
  - polymorphism

